import React from 'react'
import './NewExpense.css'
import ExpenseForm from './ExpenseForm'
const NewExpense = (props) => {
    console.log('INI PROPS PARENT ->',props)
    const saveExpenseDataHandler = (enteredExpenseData) => {
        console.log('enteredExpenseData',enteredExpenseData)
        const expenseData = {
            ...enteredExpenseData,
            id: Math.random().toString(),
            title: enteredExpenseData.title,
            amount: enteredExpenseData.amount,
            dates: enteredExpenseData.dates
        }
        props.getData(expenseData)
    }
    return (
        <div className="new-expense">
            <ExpenseForm onSaveExpenseData={saveExpenseDataHandler} />
        </div>
    )
}

export default NewExpense
